import Link from "next/link";
import { Component } from "react";

class NavMenu extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="NavMenu">
        <Link href="/blog">
          <a>Blog</a>
        </Link>
        {/* <Link href="/shop">
        <a>Shop</a>
      </Link> */}
      </div>
    );
  }
}

export default NavMenu;
